// src/components/Dashboard.js
import React from 'react';

function Dashboard({ progress, onStartDisclosure }) {
  return (
    <div style={{ padding: 20 }}>
      <h1>Seller Disclosure Dashboard</h1>
      <p>Progress: {progress.completed} of {progress.total} steps complete</p>
      <progress value={progress.completed} max={progress.total} style={{ width: '100%' }} />
      <ul>
        <li style={{ color: progress.completed >= 1 ? 'green' : 'grey' }}>AI-guided form completion</li>
        <li style={{ color: progress.completed >= 2 ? 'green' : 'grey' }}>Document uploads</li>
        <li style={{ color: progress.completed >= 3 ? 'green' : 'grey' }}>E-sign disclosure form</li>
      </ul>
      <button onClick={onStartDisclosure}>Start/Continue Disclosure Test</button>
    </div>
  );
}

export default Dashboard;
